script: |
  super -f text -I q5139.spq | sort > q5139.out

inputs:
  - name: q5139.spq
    data: |
      SELECT - col1 * + cor0.col0 + + col0 * - cor0.col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 * cor0.col2 - + col1 BETWEEN col1 AND NULL;
  - name: tab1

outputs:
  - name: q5139.out
    data: |
